import React, { useState, useEffect } from 'react';
// import DoctorForm from '../Components/Docpage';
import DoctorCard from '../Components/doccard';

function DoctorPage() {
    const [doctors, setDoctors] = useState([]);

    useEffect(() => {
        fetch('http://localhost:3000/Doctors/view')
            .then(response => response.json())
            .then(setDoctors)
            .catch(error => console.error('Error:', error));
    }, []);

    const handleUpdateDoctors = (updatedDoctors) => {
        setDoctors(updatedDoctors);
    };

    return (
        <div>
            {doctors.map(doctor => (
                <div key={doctor.id}>
                    <DoctorCard doctor={doctor} />
                    {/* <DoctorForm doctor={doctor} onUpdate={handleUpdateDoctors} /> */}
                </div>
            ))}
        </div>
    );
}

export default DoctorPage;
